			shellPath = /bin/sh;
			shellScript = "# Merge Script\n# original from http://code.hootsuite.com/an-introduction-to-creating-and-distributing-embedded-frameworks-in-ios/\n\n# 1\n# Set bash script to exit immediately if any commands fail.\nset -e\n\n# 2\n# Setup some constants for use later on.\nFRAMEWORK_NAME=\"Vorbis\"\nMACOS_FRAMEWORK_NAME=\"${FRAMEWORK_NAME}_macOS\"\nIOS_FRAMEWORK_NAME=\"${FRAMEWORK_NAME}_iOS\"\nTVOS_FRAMEWORK_NAME=\"${FRAMEWORK_NAME}_tvOS\"\nCONF=\"Release\"\n\nBASE_DIR=\"${SRCROOT}/build\"\nMACOS_FRAMEWORK_PATH=\"${BASE_DIR}/${CONF}/${MACOS_FRAMEWORK_NAME}.framework\"\nIOS_FRAMEWORK_PATH=\"${BASE_DIR}/${CONF}-iphoneos/${IOS_FRAMEWORK_NAME}.framework\"\nIOS_SIM_FRAMEWORK_PATH=\"${BASE_DIR}/${CONF}-iphonesimulator/${IOS_FRAMEWORK_NAME}.framework\"\nTVOS_FRAMEWORK_PATH=\"${BASE_DIR}/${CONF}-appletvos/${TVOS_FRAMEWORK_NAME}.framework\"\nTVOS_SIM_FRAMEWORK_PATH=\"${BASE_DIR}/${CONF}-appletvsimulator/${TVOS_FRAMEWORK_NAME}.framework\"\n\nMACOS_BIN_PATH=\"${MACOS_FRAMEWORK_PATH}/${MACOS_FRAMEWORK_NAME}\"\nIOS_BIN_PATH=\"${IOS_FRAMEWORK_PATH}/${IOS_FRAMEWORK_NAME}\"\nIOS_SIM_BIN_PATH=\"${IOS_SIM_FRAMEWORK_PATH}/${IOS_FRAMEWORK_NAME}\"\nTVOS_BIN_PATH=\"${TVOS_FRAMEWORK_PATH}/${TVOS_FRAMEWORK_NAME}\"\nTVOS_SIM_BIN_PATH=\"${TVOS_SIM_FRAMEWORK_PATH}/${TVOS_FRAMEWORK_NAME}\"\n\n# 3\n# If remnants from a previous build exist, delete them.\nif [ -d \"${BASE_DIR}\" ]; then\nrm -rf \"${BASE_DIR}\"\nfi\n\n# 4\n# Build the framework for device and for simulator (using\n# all needed architectures).\n\n# macOS\nxcodebuild -target \"${MACOS_FRAMEWORK_NAME}\" -configuration Release -arch i386 -arch x86_64 only_active_arch=no defines_module=yes -sdk \"macosx\"\n\n# iOS\nxcodebuild -target \"${IOS_FRAMEWORK_NAME}\" -configuration \"${CONF}\" -arch arm64 -arch armv7 -arch armv7s only_active_arch=no defines_module=yes -sdk \"iphoneos\"\n\n# iOS Simulator\nxcodebuild -target \"${IOS_FRAMEWORK_NAME}\" -configuration \"${CONF}\" -arch x86_64 -arch i386 only_active_arch=no defines_module=yes -sdk \"iphonesimulator\"\n\n# tvOS\nxcodebuild -target \"${TVOS_FRAMEWORK_NAME}\" -configuration \"${CONF}\" -arch arm64 only_active_arch=no defines_module=yes -sdk \"appletvos\"\n\n# tvOS Simulator\nxcodebuild -target \"${TVOS_FRAMEWORK_NAME}\" -configuration \"${CONF}\" -arch x86_64 only_active_arch=no defines_module=yes -sdk \"appletvsimulator\"\n\n# 5\n# Remove .framework file if exists on Desktop from previous run.\nFAT_DIR=\"$SRCROOT/../../Framework\"\n\nif [ -d \"${FAT_DIR}\" ]; then\nrm -rf \"${FAT_DIR}\"\nfi\nmkdir -p ${FAT_DIR}\n\n# 6\n# Copy the device version of framework to FAT directory.\n\n# macOS: just copy\ncp -r \"${MACOS_FRAMEWORK_PATH}\" \"${FAT_DIR}/${MACOS_FRAMEWORK_NAME}.framework\"\n\n# iOS\ncp -r \"${IOS_FRAMEWORK_PATH}\" \"${FAT_DIR}/${IOS_FRAMEWORK_NAME}.framework\"\n\n# tvOS\ncp -r \"${TVOS_FRAMEWORK_PATH}\" \"${FAT_DIR}/${TVOS_FRAMEWORK_NAME}.framework\"\n\n# 7\n# Replace the framework executable within the framework with\n# a new version created by merging the device and simulator\n# frameworks' executables with lipo.\n\n# iOS FAT\nlipo -create -output \"${FAT_DIR}/${IOS_FRAMEWORK_NAME}.framework/${IOS_FRAMEWORK_NAME}\" \"${IOS_BIN_PATH}\" \"${IOS_SIM_BIN_PATH}\"\n\n# tvOS FAT\nlipo -create -output \"${FAT_DIR}/${TVOS_FRAMEWORK_NAME}.framework/${TVOS_FRAMEWORK_NAME}\" \"${TVOS_BIN_PATH}\" \"${TVOS_SIM_BIN_PATH}\"\n\n# 8\n# Delete the most recent build.\nif [ -d \"${BASE_DIR}\" ]; then\nrm -rf \"${BASE_DIR}\"\nfi\n";
